import React from 'react'
import { useState,useEffect } from 'react'
import {MovieAPIKey} from '../../API/MovieAPI'
import MovieAPI from '../../API/MovieAPI'


const MovieList = () => {
    const [MovieListArray,setMovieListArray] = useState([]);

    const getMoviesList = async() => {
        const search ="har";
        const movieList = await MovieAPI.get(`?apiKey=${MovieAPIKey}&type=movie&s=${search}`);


    }

    useEffect(() => {
        getMoviesList();

    }, [])







    return (
        <div>
            <h1>Movie List</h1>

        </div>
    )
}

export default MovieList
